        public void EncryptCredential_ShouldReturnEncryptedProperties(string login, string password, string domain)
        {
            // Arrange
            var newCredential = new Credential();
            newCredential.Title = "Test Credential";
            newCredential.Login = login;
            newCredential.Password = password;
            newCredential.Domain = domain;

            var encryptionService = new EncryptionService();
            var assetService = new AssetService(
                _mockDbContext.Object,
                _mockProjectsService.Object,
                encryptionService,
                _mockEventService.Object,
                _mockApplicationIdentityService.Object);

            // Act
            assetService.EncryptAsset(newCredential);

            // Assert
            Assert.NotEqual(login, newCredential.Login);
            Assert.NotEqual(domain, newCredential.Domain);
            Assert.NotEqual(password, newCredential.Password);
        }

