        public void EncryptDecryptNote_ShouldReturnSameProperties(string title, string body)
        {
            // Arrange
            var newNote = new Note();
            newNote.Title = title;
            newNote.Body = body;

            var encryptionService = new EncryptionService();
            var assetService = new AssetService(
                _mockDbContext.Object,
                _mockProjectsService.Object,
                encryptionService,
                _mockEventService.Object,
                _mockApplicationIdentityService.Object);

            // Act
            assetService.EncryptAsset(newNote);
            assetService.DecryptAsset(newNote);

            // Assert
            Assert.Equal(title, newNote.Title);
            Assert.Equal(body, newNote.Body);
        }

        protected Note CreateTestNote()
        {
            var title = "Test note 12345";
            var body = "Test body test body Test body test body Test body test body Test body test body";

            var testNote = new Note();
            testNote.Title = title;
            testNote.Body = body;
            testNote.IsArchived = false;

            return testNote;
        }

        protected Credential CreateTestCredential()
        {
            var login = "Login123";
            var pass = "Password";
            var domain = "DOMAIN";

            var testCredential = new Credential();
            testCredential.Login = login;
            testCredential.Password = pass;
            testCredential.Domain = domain;
            testCredential.IsArchived = false;

            return testCredential;
        }
